targets.query:
from(bucket: v.bucket)
  |> range(start: v.timeRangeStart, stop: v.timeRangeStop)
  |> filter(fn: (r) => r["_measurement"] == "jmeter" and r["application"] == "${project}" and r["testRun"]== "${run}" and r["transaction"] == "all" and  r["_field"] == "count" and r["statut"] == "all")
  |> map(fn: (r) => ({
    r with
    _value: int(v: r._value) / ${send_interval}
  })
)
  |> set(key: "_field", value: "RPS")
  |> aggregateWindow(every: ${send_interval}s, fn: mean, createEmpty: false)

